import React, { useEffect } from 'react';
import { Calendar } from '@fullcalendar/core';
import googleCalendarPlugin from '@fullcalendar/google-calendar';
import './winCalendar.css';

function winCalendar() {
    useEffect(() => {
        const calendarEl = document.getElementById('calendar');

        if (calendarEl) {
            let calendar = new Calendar(calendarEl, {
                plugins: [googleCalendarPlugin],
                googleCalendarApiKey: 'AIzaSyCNuPc8INoIhejkZ0ZpBgqxMMubNbs7Twc', // Your API key here
                events: {
                    googleCalendarId: 'c_6ac1b95b43f0bc6b7729121b7f5eb6af644b44192b24c7cd2a648282e9d5df0d@group.calendar.google.com' // Your Calendar ID
                }
            });

            calendar.render();
        }
    }, []);

    return (
        <div className="winCalendar">
            <div className="header">
                <h1>CALENDAR SECTION</h1>
            </div>
            <div id="calendar">CALENDAR HERE</div>
        </div>
    );
}

export default winCalendar;
